(1, 'A közösségről', 'a-kozosseg', '<p align=\"justify\">Az ember alapvető lételeme a valahova való tartozás. Ugyanis az emberi természethez hozzátartozik, hogy nem csak egy sziget egy önálló személy, hanem egyben társas lény is. A másokhoz való kapcsolódás alapigényünk, amely nélkül nem élhetünk teljes életet.</p><p align=\"justify\">A közösség tulajdonképpen emberek egy csoportját jelenti, akik valamiben\r\n osztoznak egymással, valami összeköti őket. Legyen szó akár \r\ntevékenységekről, célokról, értékekről vagy törekvésekről.</p><p align=\"justify\">  </p><p align=\"justify\">Számunkra ez az összekötő kapocs Isten, akit az életünk középpontjába állítunk és amely meghatározza a világhoz való viszonyunkat. Ezért amikor közösségekről beszélünk, akkor az Istenbe vetett hit jelenti számunkra azt az alapértéket, amelyet közös nevezőnek tekintünk.<br></p><p align=\"justify\">Az elmagányosodás, a sehova sem való tartozás korunk egyik nagy problémája. Erre való válaszként hoztuk létre a kozossegek.hu weblapot amely a közösségkeresést segíti elő, hogy aki keres az találjon. </p><p><br></p><p><span style=\"background-color: rgb(255, 255, 255);\"><b>Ajánló</b></span></p><ul><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.youtube.com/watch?v=aqqz1mbeGTU\" target=\"_blank\">Mire jó egy keresztyén közösség?</a> </b>c. videó - shoeshine.hu </span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://777blog.hu/2016/09/20/5-erv-hogy-elkezdj-kozossegbe-jarni/\" target=\"_blank\">5 érv, hogy elkezdj közösségbe járni</a> </b>c. írás - 777blog</span></li><li><b><a href=\"https://blog.palferi.hu/nem-letezik-valakihez-tartozas-anelkul-hogy-sajat-elkepzelesek-ne-kerulnenek-olykor-zarojelbe/\" target=\"_blank\">Nem létezik valakihez tartozás anélkül, hogy a saját elképzelések ne kerülnének olykor zárójelbe</a></b> - Pál Feri</li><li><b><a href=\"https://777blog.hu/2016/09/27/3-1-szempont-kozossegvalasztashoz/\" target=\"_blank\">3+1 szempont a megfelelő közösség kíválasztásához</a></b> c. írás - 777blog</li><li><b><a href=\"https://www.magyarkurir.hu/kulhoni/a-kozossegbe-tartozas-orom-szatmari-egyhazmegye-ifjusagi-csoportvezetoi-talalkoztak\" target=\"_blank\">A közösségbe tartozás öröm</a></b> c. írás - Magyar Kurír<br></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.youtube.com/watch?v=4wUnVQtrGAE\" target=\"_blank\">...valamiért sok fiatal akar csatlakozni</a></b> - videó a Fúzió közösségről</span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"http://frszilveszter.blogspot.com/2016/07/keress-magadnak-egy-jo-kozosseget-imre.html\" target=\"_blank\">Keress magadnak egy jó közösséget</a></b> - Szilveszter Barát Blogja</span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.magnificat.ro/portal/index.php/hu/csaba-testvmainmenu-42/levelei-mainmenu-246/21724-istennek-hala-ez-a-kozosseg-ma-is-el\" target=\"_blank\">Istennek hála ez a közösség ma is él</a></b> c. írás - Böjte Csaba</span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.halo.hu/index.php/kiskozossegek/kiskozosseget-szeretnenk/bekapcsolodas\" target=\"_blank\">Csatlakozás egy működő közösséghez</a></b> - Háló Egyesület honlapja</span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.halo.hu/index.php/kiskozossegek/kiskozosseget-szeretnenk/indulas\" target=\"_blank\">Hogyan hozzunk létre új kisközösséget?</a></b> - Háló Egyesület honlapja</span></li><li><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255);\"><b><a href=\"https://www.halo.hu/index.php/kiskozossegek/kiskozosseget-szeretnenk/vezetes\" target=\"_blank\">Hogyan vezessünk közösséget?</a></b> - Háló Egyesület honlapja<br></span><br></span><span style=\"background-color: rgb(255, 255, 255);\"><b>\"keressetek és találtok...\"</b></span><br><span style=\"background-color: rgb(255, 255, 255);\"></span></li></ul>', 4, 'PUBLISHED', '2020-10-08 14:33:48', '2021-01-26 02:04:34', NULL, '/images/a_kozossegrol.jpg', '0.5'),
(2, 'Rólunk', 'rolunk', '<p align=\"justify\">Mindannyiunk életében fontos szerepet játszik a közösség, ahová tartozunk, ahol egymással és Istennel tudunk találkozni. A személyes beszélgetések által jobban megismerhetjük önmagunkat és környezetünket, elmélyülhetünk a hitben és erőt meríthetünk a ránk váró feladatok elvégzéséhez.</p><p align=\"justify\">Ezt a számunkra fontos tapasztalatot szeretnénk megosztani másokkal, ezért hoztuk létre ezt a felületet. A kozossegek.hu szegedi katolikus fiatal felnőttek alulról szerveződő önkéntes kezdeményezése, amely keresztény közösségeket gyűjt össze szerte az országban.<br></p><div class=\"row profile-images\"><div class=\"col-md-6\"><p style=\"color: rgb(33, 37, 41); text-align: center;\"></p><p style=\"color: rgb(33, 37, 41); text-align: center;\"><img style=\"width: 150px;\" src=\" /storage/uploads/Anna2.jpg\"><br></p><p style=\"color: rgb(33, 37, 41); text-align: center;\">Anna<br><span style=\"font-size: 12px;\"><i>design</i></span></p></div><div class=\"col-md-6\"><p style=\"color: rgb(33, 37, 41); text-align: center;\"></p><p style=\"color: rgb(33, 37, 41); text-align: center;\"><img style=\"width: 150px;\" src=\" /storage/uploads/kos.jpg\"><br></p><p style=\"color: rgb(33, 37, 41); text-align: center;\">Ákos<br><span style=\"font-size: 12px;\"><i>írott tartalom</i></span></p></div><div class=\"col-md-6\"><p style=\"color: rgb(33, 37, 41); text-align: center;\"></p><p style=\"color: rgb(33, 37, 41); text-align: center;\"><img style=\"width: 150px;\" src=\" /storage/uploads/Benedek2.jpg\"><br></p><p style=\"color: rgb(33, 37, 41); text-align: center;\">Benedek<br><span style=\"font-size: 12px;\"><i>kapcsolattartás</i></span></p></div><div class=\"col-md-6\"><p style=\"color: rgb(33, 37, 41); text-align: center;\"></p><p style=\"color: rgb(33, 37, 41); text-align: center;\"><img style=\"width: 150px;\" src=\" /storage/uploads/Iván.jpg\"><br></p><p style=\"color: rgb(33, 37, 41); text-align: center;\">Iván<br><span style=\"font-size: 12px;\"><i>honlapfejlesztés</i></span></p></div></div>\r\n<table class=\"table table-sm table-borderless\"><tbody><tr><td><p style=\"text-align: center; \"><br></p></td></tr></tbody></table><br><table class=\"table table-sm table-borderless\"><tbody><tr><td style=\"text-align: center; \"></td></tr></tbody></table>', 4, 'PUBLISHED', '2020-10-13 14:19:38', '2021-01-27 22:09:50', NULL, '', '0.5'),
(3, 'Adatvédelmi nyilatkozat', 'adatvedelmi-nyilatkozat', '<p align=\"center\" style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 14pt;\"><b>Adatvédelmi nyilatkozat<br></b></font></font><font color=\"#0000ff\"><u><a href=\"http://www.kozossegek.hu/\" style=\"color: rgb(0, 0, 255);\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 14pt;\"><b>www.kozossegek.hu</b></font></font></a></u></font></p><p align=\"center\" style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>A. Bevezetés</b></font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Nagyon fontos számunkra a weboldalunkra látogatók személyes adatainak védelme, és elkötelezettek vagyunk ennek megfelelő biztosítása mellett. Ez az adatvédelmi nyilatkozat tájékoztatást nyújt arról, hogy hogyan kezeljük az Ön személyes adatait.</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ha Ön, első weboldalunkra látogatásakor hozzájárul a sütik használatához a jelen adatvédelmi nyilatkozat feltételeinek megfelelően, azzal engedélyezi számunkra a sütik használatát minden egyes alkalommal, amikor Ön ismételten meglátogatja weboldalunkat.</font></font></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>B. Forrás</b></font></font><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><br>Ez a dokumentum a SEQ Legal (seqlegal.com) sablonján alapszik, amelyet a Website Planet (</font></font><a href=\"https://www.websiteplanet.com/\" style=\"color: rgb(0, 0, 255); text-decoration-line: underline;\"><font color=\"#0000ff\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><u>www.websiteplanet.com</u></font></font></font></a><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">), ill. a </font></font><font color=\"#0000ff\"><u><a href=\"http://www.kozossegek.hu/\" style=\"color: rgb(0, 0, 255);\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">www.kozossegek.hu</font></font></a></u></font><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"> módosított.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>C. A személyes adatok gyűjtése</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A következő típusú személyes adatokat gyűjthetjük, tárolhatjuk és felhasználhatjuk:</font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a számítógépével kapcsolatos információkat, beleértve az Ön IP-címét, a földrajzi tartózkodási helyét, a böngészője típusát és verzióját, valamint az operációs rendszerét;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">információkat a weboldalunk meglátogatásáról és annak használatáról, ideértve a küldő hivatkozás adatait, a látogatás hosszát, az oldalmegtekintéseket és a weboldalon a navigáció adatait;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon a regisztrációkor megadott információkat, például az e-mail címét;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon a profil létrehozásakor megadott információkat — például: a neve, profilképe, neme, telefonszáma, e-mail címe;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon közösség regisztrációjakor megadott adatokat, például: a közösség neve, a plébánia/intézmény neve, az intézményvezető neve, a közösség típusa, a közösség korosztálya, az alkalmak gyakorisága, a közösségi alkalmak konkrét napjai, lelkiségi mozgalomhoz való tartozás, a közösség jellemzői, a közösség leírása, ill. a közösségről feltöltött kép vagy képek.</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon az e-mailes levelezőlistára és/vagy hírleveleinkre feliratkozáskor megadott információkat, például: a neve, e-mail címe;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon a szolgáltatásaink igénybevételekor megadott információkat;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk használata közben keletkező információkat, többek között, hogy mikor, milyen gyakran és milyen körülmények között használja weboldalunkat;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk keresőmezőjébe beírt információkat;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">az interneten való közzététel céljából a weboldalunk számára elküldött információkat, többek között: a felhasználóneve, a profilképei és az üzenetei tartalma;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">az e-mailben vagy a weboldalunkon keresztül az Ön által elküldött információkat, beleértve azok tartalmát és metaadatait;</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">minden egyéb személyes információt, amelyet elküldött számunkra.</font></font></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Mielőtt valamely másik személy személyes adatait feltárná előttünk, Önnek kötelező az adott személy hozzájárulásával rendelkeznie a személyes adatok megosztását valamint a személyes adatoknak a jelen adatvédelmi nyilatkozat előírásaival összhangban történő feldolgozását illetően.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>D. Az Ön személyes adatainak felhasználása</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A weboldalunkon keresztül számunkra elküldött személyes adatokat a jelen adatvédelmi nyilatkozatban vagy a weboldal vonatkozó oldalain meghatározott célokra használjuk fel.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Az Ön személyes adatait a következő célokra használhatjuk fel:</font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk adminisztrálása;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk testreszabása az Ön számára;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon található szolgáltatások elérhetővé tétele az Ön számára</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkon elérhető keresőfelület személyre szabására;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">olyan e-mail értesítések küldése Önnek, amelyeket Ön kifejezetten kért;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">e-mail hírlevelünk küldése Önnek, ha azt igényelte (bármikor értesíthet minket, ha már nem kéri a hírlevelet);</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">weblapunk illetve gondosan kiválasztott harmadik felek programjaival kapcsolatos marketingkommunikációk küldése az Ön részére e-mailben vagy hasonló technológia alkalmazásával (bármikor értesíthet minket, ha már nem kéri a hírlevelet);</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">harmadik felek számára statisztikai információk szolgáltatása felhasználóinkról (azonban ezek a harmadik felek nem azonosíthatnak egyetlen felhasználót sem ezen információk alapján);</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunkkal kapcsolatos, az Ön által vagy az Önről tett tudakozódások és panaszok kezelése;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk biztonságának megőrzése és a csalások megelőzése;</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a weboldalunk használatát szabályozó feltételek betartásának ellenőrzése (ideértve a weboldal privát üzenetküldő szolgáltatásán keresztül küldött privát üzenetek nyomon követését is);</font></font></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ha Ön személyes információkat küld nekünk a weboldalunkon való közzététel céljából, ezeket az információkat mi közzétesszük és egyéb módon felhasználjuk az Ön által nekünk megadott engedély alapján.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Az Ön adatvédelmi beállításai korlátozhatják az adataira vonatkozóan a közzétételt a weboldalunkon, ezek a beállítások pedig módosíthatók a weboldalon az adatvédelmi beállítási lehetőségek használatával.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Az Ön kifejezett hozzájárulása nélkül nem adjuk át az Ön személyes adatait harmadik feleknek ezen harmadik felek vagy más harmadik felek által folytatott közvetlen marketing céljából.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>E. A személyes adatok közzététele</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A személyes adatait bármilyen alkalmazottunkkal, tisztségviselőnkkel, biztosító társasággal, szakmai tanácsadókkal, ügynökökkel, beszállítókkal vagy alvállalkozókkal közölhetjük, amennyiben ez ésszerű és szükséges a jelen adatvédelmi nyilatkozatban meghatározott célok biztosításához.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A személyes adatait közzétehetjük:</font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">olyan mértékben, amennyire a törvény ezt megköveteli;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a folyamatban lévő vagy jövőbeni bírósági eljárásokkal kapcsolatban;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">a törvényes jogaink megállapítása, gyakorlása vagy védelme érdekében</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">bármely olyan személy számára, akinek az esetében ésszerűen feltételezhetjük, hogy bírósághoz vagy más illetékes hatósághoz fordulhat a személyes információ közzététele érdekében, amennyiben ésszerű véleményünk szerint az ilyen bíróság vagy hatóság valószínűleg elrendelné az említett személyes információ közzétételét.</font></font></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A jelen adatvédelmi nyilatkozatban foglalt esetek kivételével az Ön személyes adatait nem adjuk át harmadik feleknek.<br></font></font><br><br></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>F. A személyes adatok megőrzése</b></font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A jelen F. szakasz tájékoztat az adatmegőrzési irányelveinkről és eljárásainkról, amelyek célja annak biztosítása, hogy a személyes adatok megőrzésére és törlésére vonatkozó jogi kötelezettségeinknek megfelelően járjunk el.</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A személyes adatokat, amelyeket bármilyen célból vagy célokból feldolgozunk, tilos annál hosszabb ideig megőrizni, mint amennyi ideig szükséges a tárolásuk ehhez a célhoz vagy célokhoz.</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>A F-2. cikkely sérelme nélkül, általában az alábbiakban meghatározott kategóriákba tartozó személyes adatokat töröljük az alábbiakban megadott dátumban/időpontban:</b></font></font></p><ol type=\"a\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>a személyes adattípus törlése ekkor történik meg: {DÁTUM/IDŐPONT}; valamint</b></font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>{TOVÁBBI DÁTUMOK/IDŐPONTOK}.</b></font></font></p></li></ol></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A F. szakasz egyéb rendelkezéseinek sérelme nélkül, a személyes adatokat tartalmazó dokumentumokat (beleértve az elektronikus dokumentumokat is) az alábbiaknak megfelelően megőrizzük:</font></font></p><ol type=\"a\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">olyan mértékben, amennyire a törvény ezt megköveteli;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">amennyiben a dokumentumok relevánsak lehetnek bármilyen folyamatban lévő vagy jövőbeni bírósági eljárásban; és</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">törvényes jogaink megállapítása, gyakorlása vagy védelme érdekében<br></font></font><br><br></p></li></ol></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>G. Az Ön személyes adatainak biztonsága</b></font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Megtesszük a megfelelő technikai és szervezeti óvintézkedéseket annak érdekében, hogy megakadályozzuk a személyes adatai elvesztését, a velük való visszaélést vagy a módosításukat.</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Minden, az Ön által megadott személyes információt biztonságos (jelszóval és tűzfallal védett) szerveren tároljuk.</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ön tudomásul veszi, hogy az információ továbbítása az interneten keresztül alapvetően bizonytalan jellegű, és nem garantálhatjuk az interneten keresztül továbbított adatok biztonságát.</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ön felelős a weboldalunk eléréséhez használt jelszava bizalmas kezeléséért; nem kérjük el a jelszavát (kivéve, amikor bejelentkezik weboldalunkra).<br><br></font></font><br><br></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>H. Módosítások</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Időnként frissíthetjük ezt az adatvédelmi nyilatkozatot azáltal, hogy közzétesszük az új verzióját a weboldalunkon. Időnként ellenőrizze ezt az oldalt annak érdekében, hogy megismerje az adatvédelmi nyilatkozat módosításait. Önt az adatvédelmi nyilatkozat változásairól e-mailben vagy a weboldalunkon található privát üzenetküldő rendszeren keresztül értesíthetjük.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>I. Az Ön jogai</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>Felszólíthat minket arra, hogy bocsássunk rendelkezésére minden személyes információt, amely nálunk elérhető Önről; az ilyen információk szolgáltatása a következő feltételek mellett történik:</b></font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>a szükséges díj befizetése ({DÍJ ÖSSZEGE, HA RELEVÁNS}); és</b></font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>az Ön személyazonosságának a megfelelő módon történő igazolása ({ÍRJA ÁT A SZÖVEGET A MEGFELELŐ MÓDON ebből a célból; általában elfogadjuk útlevelének fénymásolatát, amelyet közjegyző hitelesít, közüzemi számla olyan eredeti példányával együtt, amely tartalmazza az Ön jelenlegi lakcímét}).</b></font></font></p></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A törvény által megengedett mértékben visszatarthatjuk az Ön által kért személyes információkat.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Bármikor felszólíthat bennünket arra, hogy marketing célból ne dolgozzuk fel személyes adatait.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A gyakorlatban Ön általában előzőleg kifejezetten egyetért azzal, hogy személyes adatait felhasználhatjuk marketing célokra, vagy pedig lehetőséget biztosítunk az Ön számára azt illetően, hogy visszautasíthassa a személyes adatai marketing célokra történő felhasználását.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>J. Harmadik felek weboldalai</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Weboldalunk hivatkozásokat és részleteket tartalmaz harmadik felek weboldalait illetően. Nem áll módunkban a harmadik felek adatvédelmi irányelveit és gyakorlatait ellenőrizni, valamint azokért nem vagyunk felelősek.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>K. Az adatok frissítése</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Kérjük, tudassa velünk, ha javítani vagy frissíteni kell az Önnel kapcsolatosan általunk tárolt személyes adatokat.</font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>L. Sütik</b></font></font></p><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Weboldalunk sütiket alkalmaz. A süti egy azonosítót (betűket és számokat) tartalmazó fájlnak felel meg, amelyet a webszerver küld a webböngészőnek, és amelyet a böngésző eltárol. Ezután megtörténik az azonosító visszaküldése a szerverhez minden alkalommal, amikor a böngésző lekér egy adott oldalt a szerverről. A sütik lehetnek „tartós” vagy „munkamenet” sütik: a tartós sütiket a böngésző tárolja, és a megadott lejárati időpontig érvényben maradnak, kivéve, ha a felhasználó a lejárati idő előtt törli őket; a munkamenet süti ezzel szemben lejár a felhasználói munkamenet végén, amikor a böngészőt bezárja a felhasználó. A sütik általában nem tartalmaznak olyan információt, amely által személyesen azonosítható lenne a </font></font><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>felhasználó, azonban az Önről általunk tárolt személyes adatok kapcsolódhatnak a sütikben tárolt illetve a sütikből kiolvasható információkhoz. {VÁLASSZA KI A MEGFELELŐ KIFEJEZÉST Weboldalunkon kizárólag munkamenet sütiket / kizárólag tartós sütiket / munkamenet sütiket és tartós sütiket is használunk.}</b></font></font></p><ol style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>Az általunk a weboldalunkon alkalmazott sütik nevét, valamint azok felhasználási céljait az alábbiakban ismertetjük:</b></font></font></p><ol type=\"a\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><b>a weboldalunkon a Google Analytics és az Adwords szoftverek segítségével a számítógép felismerése, amikor egy felhasználó {ADJA HOZZÁ AZ ÖSSZES FELHASZNÁLÁSI CÉLT meglátogatja a weboldalt / a felhasználók nyomon követése, miközben navigálnak a weboldalon / a kosár használatának lehetősége a weboldalon / a weboldal használhatóságának javítása / a weboldal használatának elemzése / a weboldal adminisztrálása / a csalások megakadályozása és a weboldal biztonságának javítása / a weboldal testreszabása minden egyes felhasználó számára / a célzott reklámok használata, amelyek adott felhasználók számára különösen érdekesek lehetnek, / további célok leírása};</b></font></font></p></li></ol></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A legtöbb böngészőben beállítható a sütik elfogadásának megtagadása — például:</font></font></p><ol type=\"a\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">az Internet Explorer böngészőben (10. verziószám) letilthatja a sütiket a sütikezelés felülbírálását érintő beállításokban, ehhez kattintson a következőkre: „Eszközök”, „Internetbeállítások”, „Adatvédelem”, végül pedig a „Speciális” opcióra;</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A Firefox böngészőben (24. verziószám) az összes süti letiltásához kattintson a következőkre: „Eszközök”, „Opciók”, „Adatvédelem”, ezután a legördülő menüből válassza az „Egyéni beállítások használata előzményekhez” opciót, és törölje a pipát a „Sütik elfogadása” opciónál; valamint</font></font></p></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A Chrome böngészőben (29. verziószám) az összes süti letiltásához válassza a „Testreszabás és vezérlés” menüt, ezután kattintson a következőkre: „Beállítások”, „Speciális beállítások megjelenítése”, „Tartalombeállítások”, végül válassza ki a „Adatmentés tiltása a webhelyeken” opciót a „Cookie-k” résznél.</font></font></p></li></ol></li></ol><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent; color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ha letiltja az összes süti használatát, akkor sok weboldal használhatósága romlani fog. A weboldalunkon pedig egyes funkciók nem lesznek elérhetők az Ön számára.</font></font></p><ol start=\"3\" style=\"color: rgb(0, 0, 0); font-family: \"Times New Roman\"; font-size: medium;\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent; margin-top: 0.49cm;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Törölheti a számítógépén már tárolt sütiket is — például:</font></font></p><ol type=\"a\"><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">az Internet Explorer böngészőben (10. verziószám) manuálisan kell törölnie a süti-fájlokat (ehhez a </font></font><a href=\"https://support.microsoft.com/kb/278835\" style=\"color: rgb(0, 0, 255); text-decoration-line: underline;\"><font color=\"#0000ff\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"><u>http://support.microsoft.com/kb/278835</u></font></font></font></a><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\"> címen talál leírást);</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A Firefox böngészőben (24. verziószám) a sütik törléséhez kattintson a következőkre: „Eszközök”, „Opciók”, „Adatvédelem”, ezután válassza az „Egyéni beállításokat használ az előzményekhez” opciót, majd kattintson a „Sütik megjelenítése” opcióra, végül az „Összes eltávolítása” elemre; valamint</font></font></p></li><li><p style=\"margin-bottom: 0cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">A Chrome böngészőben (29. verziószám) az összes süti törléséhez válassza a „Testreszabás és vezérlés” menüt, ezután kattintson a következőkre: „Beállítások”, „Speciális beállítások megjelenítése”, „Böngészési adatok törlése”, utóbbinál pedig válassza az „Összes cookie és webhelyadat” lehetőséget, mielőtt a „ Böngészési adatok törlése” elemre kattint.</font></font></p></li></ol></li><li><p style=\"margin-bottom: 0.49cm; direction: ltr; line-height: 16px; background: transparent;\"><font face=\"Times New Roman, serif\"><font style=\"font-size: 12pt;\">Ha törli a sütiket, akkor sok weboldal használhatósága romlani fog.</font></font></p></li></ol>', 1, 'PUBLISHED', '2020-10-14 19:15:32', '2020-12-26 23:55:14', NULL, '', '0.5'),
(4, 'Impresszum', 'impresszum', '<p style=\"text-align: center; \"><span style=\"background-color: transparent;\"><span style=\"font-size: 16px;\">A <b>kozosse</b></span></span><span style=\"font-size: 16px;\"><b>﻿</b></span><span style=\"background-color: transparent;\"><span style=\"font-size: 16px;\"><b>gek.hu</b> önkéntesek által fenntartott, katolikus közösség kereső oldal.</span></span></p><p style=\"text-align: center;\"><span style=\"background-color: transparent;\"><span style=\"font-size: 16px;\">Az oldal gazdasági tevékenységet nem végez, a működtetésből bevétel nem származik,<br></span></span><span style=\"background-color: transparent; font-size: 16px\">nyereségre nem törekszik.</span></p><h5 align=\"left\"><span style=\"background-color: transparent;\"><span style=\"font-size: 18px;\"></span></span><b><br></b></h5><p align=\"left\"></p><div style=\"text-align: center;\"><b>Szerkesztők:</b></div><div style=\"text-align: center;\">Bauer Iván</div><div style=\"text-align: center;\">Nagy Anna</div><div style=\"text-align: center;\">Rónaszéki Benedek</div><div style=\"text-align: center;\">Urbán Ákos</div><p></p><p align=\"left\" style=\"text-align: center;\"><b>Fotók:</b> Mózes Anita</p><p align=\"left\" style=\"text-align: center;\"><b>Szerver szolgáltató<br>Cégnév:&nbsp;</b><span style=\"text-align: left;\">C-Host Kft<br><b>Székhely:&nbsp;</b>1115 Budapest, Halmi utca 29.<br></span></p>', 1, 'PUBLISHED', '2020-12-27 17:38:18', '2021-01-29 20:08:24', NULL, '', '0.5'),
(5, 'Irányelveink', 'iranyelveink', '<div align=\"center\"><span style=\"font-weight: bolder;\"><span style=\"font-size: 24px;\">Irányelvek</span></span><br><a href=\"https://kozossegek.hu\" target=\"_blank\">www.kozossegek.hu</a><br></div><p><br><span style=\"font-weight: bolder;\">Bevezetés</span><br>A&nbsp;<a href=\"https://kozossegek.hu\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">www.kozossegek.hu</a>&nbsp;egy alulról szerveződő, katolikus értékrendet valló weboldal, melynek célja a Magyar Katolikus Egyházhoz tartozó közösségek összefogása, illetve a keresztény közösséghez tartozás népszerűsítése.<br><br><span style=\"font-weight: bolder;\">Alapelvek</span><br>Fontosnak tartjuk, hogy a honlapon megjelenő mindennemű tartalom:&nbsp;<br>1.&nbsp;&nbsp;&nbsp; a valóságnak megfeleljen,<br>2.&nbsp;&nbsp;&nbsp; a katolikus értékrenddel (irányadó: A&nbsp;<a href=\"https://archiv.katolikus.hu/kek/tartalom.html\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Katolikus Egyház Katekizmusa</a>) ne ütközzön,<br>3.&nbsp;&nbsp;&nbsp; politikától mentes legyen.<br><br><span style=\"font-weight: bolder;\">A közösségek hitelessége</span><br>Az oldalunkon megjelenő közösségek hitelessége, a velük kapcsolatban álló katolikus intézmény (plébánia, templomigazgatóság, iskola, lelkészség stb.) vezetője / képviselője által kerül jóváhagyásra.</p><p>Amennyiben egy közösség tevékenységével, vagy hitelességével kapcsolatban a felhasználói visszajelzések alapján probléma merül fel, weboldalunk szerkesztősége vizsgálatot indít az&nbsp; összeférhetetlenségi pontok alapján.</p><p>Amennyiben egy közösségről tényszerűen megállapítható az irányelveinkkel való összeférhetetlenség, az adott közösség törlésre kerül weblapunkról.</p><p><br><span style=\"font-weight: bolder;\">Nem katolikus közösségek</span><br>Nyitottak vagyunk mindenre, a katolikustól eltérő, más felekezetű közösséggel az építő párbeszédre, de céljaink szerint kizárólag katolikus közösségek számára nyújtunk megjelenési lehetőséget honlapunkon.<br></p>', 1, 'PUBLISHED', '2020-12-28 21:46:45', '2021-01-31 16:40:18', NULL, '', '0.5');
INSERT INTO `pages` (`id`, `title`, `slug`, `content`, `user_id`, `status`, `created_at`, `updated_at`, `deleted_at`, `header_image`, `priority`) VALUES
(6, 'Főoldal', 'fooldal', '<div class=\"jumbotron main-block mt-0\"><div class=\"container\"><h2 style=\"text-align: center; \"><span>Mi ez az oldal?</span></h2><h2 style=\"text-align: center; \"><span><br></span></h2><div style=\"text-align: center;\">Ez egy katolikus közösségkereső portál, amelyet azért hoztunk létre, hogy segítsünk mindenkinek megtalálni a közösségét akárhol is éljen, tanuljon, vagy dolgozzon, nemtől, kortól, életállapottól függetlenül. Hisszük, hogy az ember alap szükséglete a közösséghez tartozás, hiszen ezáltal tud önmaga lenni, így tud megbirkózni az élet nehézségeivel, így válhat az élete teljessé.</div></div><div class=\"container main-block\" style=\"text-align: center;\">Kívánjuk, hogy ismerd fel azt az erőt, amely a keresztény közösségekben rejlik, találd meg saját helyedet és légy aktív tagja az Egyháznak!<br></div><div class=\"container main-block\" style=\"text-align: center;\"><b>\"Ahol ugyanis ketten vagy hárman összegyűlnek a nevemben, ott vagyok közöttük.” Mt.18,20</b><br></div></div><div class=\"container main-block\"><br><h2 class=\"text-center\">Hogyan működik?</h2>\r\n    <div class=\"row mt-5 mb-5\" id=\"instructions\">\r\n        <div class=\"col-md-4 text-center\">\r\n            <img src=\"/images/search.png\" style=\"width: 100px;\">\r\n            <h6 class=\"text-danger mt-4 mb-3\">Keresd meg!</h6>\r\n            <p>Keress rá településre, lelkiségi mozgalomra, <br>a közösség jellegére, vagy ami számodra fontos egy közösségben!</p>\r\n        </div>\r\n        <div class=\"col-md-4 text-center\">\r\n            <img src=\"/images/mouse.png\" style=\"width: 100px;\">\r\n            <h6 class=\"text-danger mt-4 mb-3\">Kattints rá!</h6>\r\n            <p>A listában megtalálható közösségekre kattintva többet megtudhatsz a részletekről!</p>\r\n        </div>\r\n        <div class=\"col-md-4 text-center\">\r\n            <img src=\"/images/contact.png\" style=\"width: 100px;\">\r\n            <h6 class=\"text-danger mt-4 mb-3\">Írj nekik!</h6>\r\n            <p>Amennyiben felkeltette az érdeklődésedet egy közösség, az adatlapján keresztül vedd fel a kapcsolatot a közösségvezetővel!</p>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"jumbotron main-block mt-0 pt-0 pb-0 kozosseghez-tartozni\">\r\n    <div class=\"container\">\r\n    <div class=\"row\">\r\n        <div class=\"col-md-6 pt-5\"></div>\r\n        <div class=\"col-md-6 pt-5\">\r\n            <div class=\"shadowed\">\r\n<h2>Mert közösséghez tartozni jó!</h2><p>Közösséghez tartozni lehetőség és felelősség is egyben.\r\nLehetőség a lelki elmélyülésre és az emberi kapcsolatok mélyítésére.\r\nUgyanakkor felelősség is, hogy az Istentől kapott készségeket, képességeket, talentumokat felhasználva mások segítségére lehessünk.<br></p><p>Kedvcsinálónak olvasd el a <a href=\"https://777blog.hu/2016/09/20/5-erv-hogy-elkezdj-kozossegbe-jarni/\" target=\"_blank\" title=\"\" data-original-title=\"5 érv, hogy elkezdj közösségbe járni\">777blog.hu írását,</a> hogy miért jó közösségbe járni!<br></p>            \r\n</div>\r\n        </div>\r\n    </div>\r\n    </div>\r\n</div>\r\n<div class=\"container main-block\">\r\n    <div class=\"row\">\r\n        <div class=\"col-md-6\"><img src=\" /storage/uploads/kozosseget_vezetek.jpg\" style=\"width: 100%;\">\r\n            \r\n        </div>\r\n        <div class=\"col-md-6 align-middle h-100\">\r\n            <h3 style=\"text-align: center; \">Közösséget vezetek, szeretném hirdetni.</h3><h3 style=\"text-align: center; \">\r\nMit tegyek?</h3><p align=\"justify\">\r\nNagyon örülünk annak, ha te is hirdetnéd nálunk a közösséged! Ehhez nem kell mást tenned, mint ellátogatnod a <a href=\"https://kozossegek.hu/kozosseg-regisztracio\" target=\"_blank\">közösséget vezetek</a> oldalra, majd az ott található űrlapot kitölteni és elküldeni nekünk. A regisztrációt követően, jóváhagyás után, közösséged a látogatók számára is elérhető lesz.</p>\r\n            <p class=\"text-center\"><a href=\"/kozosseg-regisztracio\" class=\"btn btn-darkblue\">Közösséget vezetek</a></p>\r\n        </div>\r\n    </div>\r\n</div>\r\n<div class=\"container main-block text-center\"><br></div>', 1, 'PUBLISHED', '2021-01-03 22:18:28', '2021-01-27 20:44:48', NULL, '', '0.5'),
(7, 'Cookie tájékoztató', 'cookie-tajekoztato', '<p>A testre szabott kiszolgálás érdekében a felhasználó számítógépén egyedi jelsorozatok, kis anonim látogatóazonosítók (cookie, süti) kerülnek elhelyezésre. A cookie-k használatának a célja az adott oldal minél magasabb színvonalú működésének biztosítása a felhasználói élmény növelése érdekében.</p><p>Fontos tudni, hogy az ilyen jelsorozat - tekintettel arra, hogy a felhasználása során a teljes IP cím tárolása nem történik meg - önmagában semmilyen módon nem képes a felhasználót, azaz a látogatót azonosítani, csak a látogató gépének felismerésére alkalmas. A felhasználásuk során személyes adatok, információk nem kerülnek továbbításra.<br></p><p>Alkalmazott cookie-k:<br></p><ul><li>Analitika, követés cookie</li><li>Webhelyen keresztüli követés cookie</li><li>Bejelentkezési, felhasználó azonosító session cookie</li></ul><p>A cookie-t képes törölni saját számítógépéről, illetve beállíthatja böngészőjét, hogy a cookie-k alkalmazását tiltsa. A legtöbb böngésző menüsorában található „Segítség” funkció tájékoztatást nyújt arra vonatkozóan:<br></p><ul><li>A böngészőben hogyan lehet letiltani a cookie-kat.</li><li>A böngészőben hogyan fogadjon el új cookie-kat.</li><li>A böngészőben hogyan adjon utasítást böngészőjének arra, hogy új cookie-t állítson be.</li><li>A böngészőben hogyan kapcsoljon ki egyéb cookie-kat.</li></ul><p>A cookie-k alkamazásának tiltásával tudomásul veszi, hogy cookie nélkül az adott oldal működése nem teljes értékű.<br></p>', 1, 'PUBLISHED', '2021-01-11 04:26:46', NULL, NULL, '', '0.5'),
(8, 'Hogyan csatlakozhatok egy közösséghez?', 'hogyan-alakitsunk-kiskozosseget', '<p><em>Aki még nem tartozik kisközösséghez, alapvetően két úton indulhat el: csatlakozik egy működő csoporthoz, vagy <span style=\"color: rgb(0, 128, 128);\"><span style=\"font-weight: 700;\"><a href=\"https://www.halo.hu/index.php/kiskozossegek/kiskozosseget-szeretnenk/indulas\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 128, 128);\">létrehoz egyet</a></span></span>. A bekapcsolódás első pillantásra egyszerűnek látszik. Találni kell (1) a kereső személyiségének megfelelő, (2) befogadó kisközösséget, (3) felvenni velük a kapcsolatot és (4) kész.</em></p><p> </p><p><span style=\"font-size: 14pt; color: rgb(0, 128, 128);\">Csatlakozás egy működő csoporthoz</span></p><p> </p><p><img src=\"https://www.halo.hu/images/Kiskozosseg/kozosseget-szeretnek/kk-bekapcsolodas.png\" alt=\"kk bekapcsolodas\" width=\"400\" height=\"299\" style=\"border: 0px; margin-left: 32px; float: right;\">Ha érzed magadban erre a vágyat, biztatunk, hogy indulj el ezen az úton. </p><p style=\"padding-left:=\" \"=\"\" 30px;\"=\"\"><span style=\"color: rgb(0, 128, 128);\"><span style=\"font-weight: 700;\">Gondold végig alaposan, hogy milyen közösséget keresel!</span></span> Sokféle kisközösség létezik. Nézz körbe a neten, de emellett érdeklődj a barátaidtól, ismerőseidtől is!</p><p style=\"padding-left:=\" \"=\"\" 60px;\"=\"\">- A plébániai közösségek általában lakóhely szerint szerveződnek, gyakran életkori vagy életállapot-beli hasonlóságok alapján. Stílusukban nagyon sokfélék lehetnek, csatlakozva a plébánia saját lelkiségi vonalához, avagy éppen nem. Van amelyik a plébániához kapcsolódva működik, ezekről a plébános vagy a plébániához tartozó másik ember tud neked információt adni.</p><p style=\"padding-left:=\" \"=\"\" 60px;\"=\"\">- Vannak lelkiségi mozgalmakhoz kapcsolódó közösségek. Ezek egy bizonyos lelkiségi stílust képviselnek. A lelkiségi mozgalmakról itt tájékozódhatsz: <span style=\"color: rgb(0, 128, 128);\"><span style=\"font-weight: 700;\"><a href=\"http://oli.katolikus.hu/?page_id=58\" target=\"_blank\" rel=\"noopener\" style=\"background-image: initial; background-position: 0px 0px; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(0, 128, 128);\">Országos Lelkipásztori Intézet, Lelkiségi mozgalmak</a></span></span>.</p><p style=\"padding-left:=\" \"=\"\" 60px;\"=\"\">- Léteznek csak férfiakat vagy csak nőket a tagjaik közé fogadó csoportok, családosak, házaspároknak szólók, valamint olyanok is, amelyhez mindenki csatlakozhat. Ha van preferenciád, gondold végig!</p><p style=\"padding-left:=\" \"=\"\" 60px;\"=\"\">- Korosztályok szerint is lehet kisközösségeket keresni. Sokak fejében a kisközösség egy tipikusan fiataloknak szóló dolog. Pedig biztosíthatunk, hogy nem feltétlenül!</p><p style=\"padding-left:=\" \"=\"\" 60px;\"=\"\">- Fontos jellemzője egy kisközösségnek, hogy mivel foglalkozik. Vannak imacsoportok, melyek az idejük nagyobb részét imára fordítják, vannak, akiknek a résztvevők élettapasztalatainak a megosztása fontosabb. Vannak, akik szentírást olvasnak, vannak, akik inkább egy könyvet vesznek elő - például a gyereknevelésről vagy egy lelki témáról. Vannak, akik szigorúbbak, vannak, akik inkább kötetlenül beszélgetnek. Vannak, akik pálinkát iszogatnak és vannak, akik teát.</p><p style=\"padding-left:=\" \"=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\"><span style=\"color: rgb(0, 128, 128);\">Fontos, hogy a közösség befogadó legyen.</span></span> Ez egy átlagos közösség esetében nem magától értetődő. Valószínűleg éveken át küzdöttek azért, hogy elérjenek az intimitásnak egy olyan szintjére, ahol már mélyen tudnak beszélgetni. Ha valaki becsöppen kívülről, ez önkéntelenül megzavarja őket. Próbáld meggyőzni őket arról, hogy nem fogod felforgatni az életüket (csak egy picit…). Ráadásul a nyitottság/zártság az időben is változhat. Sok közösségben megfigyelhető a zárt (összeszokást erősítő) és nyitott (kilépő vagy befogadó) fázisok váltakozása. Ha egyszer nemet mondott egy közösség megkeresésedre, ne vedd zokon, hanem próbáld meg egy idő után újra!</p><p style=\"padding-left:=\" \"=\"\" 30px;\"=\"\"><span style=\"color: rgb(0, 128, 128);\"><span style=\"font-weight: 700;\">Persze már megtalálni is nehéz a kisközösségeket.</span></span> A plébániákon működő kisközösségekről és az úgynevezett nomád közösségekről - amelyek nem kapcsolódnak egy-egy konkrét “intézményhez” - nincsenek regiszterek, listák. (A lelkiségi mozgalmaknál azért igen.) Néha az sem világos, hogy egy közösségnek ki a vezetője, kihez fordulhatsz. Légy bátor! A benned lévő vágy megvan (de legalábbis megvolt) azokban az emberekben, akik a közösségben vannak. Szólítsd meg őket, kérj tőlük tanácsot! Gyakran az egyik közösség tagjai jobban ismerik a többi közösséget, mint akár a plébános. Tehát például ha nem is vagy már fiatal, szólítsd meg az ifi közösség tagjait, hogy ismernek-e felnőtt közösséget a plébánián!</p><p style=\"padding-left:=\" \"=\"\" 30px;\"=\"\"><span style=\"font-weight: 700;\"><span style=\"color: rgb(0, 128, 128);\">Ha megvan a közösség, és befogadtak, akkor sem lesz egyszerű az eleje.</span></span> Állj ki magadért és egyben legyél rugalmas! Ne add fel!</p><p>Talán ijesztőnek tűnhetett ez a felsorolás… Inkább úgy fogalmaznék, hogy ha már megvan benned a szándék, akkor úgyis lépni fogsz. Amit leírtunk, inkább felkészíthet a nehézségekkel való találkozásra.</p><p>Ha szükséged van segítségre, keress meg minket. A közösség megtalálásában nem mindig tudunk segíteni, de hátha neked éppen igen.</p><p><br></p><p><br></p><p><b>Forrás: <a href=\"https://www.halo.hu/index.php/kiskozossegek/kiskozosseget-szeretnenk/bekapcsolodas\" target=\"_blank\">halo.hu</a></b></p>', 1, 'DRAFT', '2021-01-27 20:13:28', '2021-01-31 16:54:07', NULL, '', '0.5'),
(9, 'Teszt', 'teszt', '<p>asdasd</p>', 1, 'PUBLISHED', '2023-04-29 15:55:32', '2023-04-29 15:55:38', NULL, '', '0.5');
