(3, 'Keresztény Munkásifjú Mozgalom', 'kereszteny-munkasifju-mozgalom', NULL, NULL, NULL, 0, '2022-03-08 00:39:47', NULL, 'spiritual_movement'),
(4, 'Katolikus Shalom Közösség', 'katolikus-shalom-kozosseg', '<p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">A Katolikus Shalom Közösség&nbsp;Brazíliából indult 1982-ben, és&nbsp;már több éve jelen van Magyarországon. 2009 októberében öt misszionárius érkezett Budapestre Erdő Péter bíboros, prímás, esztergom-budapesti érsek meghívására, hogy hazánkban is elvigyék a fiataloknak Krisztus örömhírét és a shalomos lelkiségen keresztül segítsenek elmélyíteni Istennel való kapcsolatukat.&nbsp;</p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">A közösség ma már több imacsoportot is vezet (a tagok egységesen, a közösség lelkiségének megfelelően a Béke útján&nbsp;járnak együtt, amelyen Jézus barátaivá válnak) Heti rendszerességgel&nbsp;imaestet, havi két alkalommal shalomos misét tart.Emellett kávézót üzemeltet, a Horváth Mihály téren található HungaRio kávézót, ahol különböző tematikus eseményekkel igyekszik közelebb vinni a Feltámadt Krisztus békéjét (Jn 20,19) az emberekhez. (társasjáték-estekkel, koncerttekkel, keresztény bulikkal, nemzetközi táborokkal, kirándulásokkal) A kávézóban brazil kávékat és éeteleket kínál, valamint a közösség kiadójának könyvei és ikonjai is megtalálhatóak a kialakított könyvesbolt részlegben.&nbsp;A közösség egészét az Életközösség és Szövetségközösség misszionáriusai, az imacsoportok, imaestek résztvevői és a közösség barátai és támaogatói (Shalom Mű) alkotják.&nbsp;</p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Ahol megtaláltok minket:&nbsp;<a href=\"https://comshalom.org/hu/\" target=\"_blank\" style=\"color: var(--darkblue);\">https://comshalom.org/hu/</a>&nbsp;Facebookon és YouTubeon: Shalom Budapest&nbsp;Instagramon: shalombudapest</p>', '/storage/uploads/lelkisegi_mozgalmak/94_1.jpg', 'https://comshalom.org/hu/', 0, '2022-03-08 00:39:47', NULL, 'spiritual_movement'),
