(8, 'Emmánuel közösség', 'emmanuel-kozosseg', '<p style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Az <span style=\"font-weight: bolder;\">Emmánuel Közösség</span> Krisztushívők pápai jogú, nemzetközi nyilvános társulása. Statútumát a Szentszék 2009-ben véglegesen jóváhagyta.<br></p><p style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Kezdetei 1972-re nyúlnak vissza, amikor Franciaországban Pierre Pierre Goursat és Martine(Lafitte) Catta a karizmatikus megújulással találkozva rendszeresen összejöttek imádkozni. Hozzájuk egyre többen csatlakoztak, így mára a Közösség az öt kontinens 80 országban mintegy 11.000 tagot számlál.</p><p style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"><span style=\"font-weight: bolder;\">Weboldal: </span><a href=\"http://www.emmanuel.hu/\" target=\"_blank\" style=\"color: var(--darkblue);\">http://www.emmanuel.hu/ </a></p>', '/storage/uploads/emmanuel_kozosseg.jpg', 'www.emmanuel.hu', 1, '2022-03-08 00:39:47', '2023-02-25 13:43:58', 'spiritual_movement'),
