(39, 'Antióchia közösség', 'antiochia-kozosseg', '<p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Az Antióchia egy-egy plébánia ifjúsági közössége, tagjainak életkora kb. 16-25 év között van.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">A csatlakozás egy hétvégi élménnyel kezdődik, amelynek rendszeres, heti folytatása van.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Az Antióchia Hétvége hangsúlyt helyez a Szentírásra és a szentségekre, a kiengesztelődés és az Eucharisztia szentségére.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">A közösség életének feladatait maguk a fiatalok végzik, egymást szolgálják, egyik ember a másikért alapon.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Házaspár jelenléte a közösségben a családegyház képét és a szentségi házasság mintáját adja a fiataloknak.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">A közösség nyitott, befogadó, ahol a tagok már a csatlakozáskor megélik a feléjük forduló figyelmességet, szeretetet.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Az Antióchia hidat ver az iskolai évek és a felnőtté válás között, a társkeresés, az életpálya elindítása, a hitben való megerősödés időszakában.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">A közösségek lendületét a fiatalok életöröme, tettre készsége hatja át.</p><p class=\"MsoNormal\" open=\"\" sans\",=\"\" sans-serif;=\"\" font-size:=\"\" 16px;\"=\"\" style=\"color: rgb(85, 85, 85); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Megélt valósága annak, hogy így együtt Krisztus Testét építjük.</p>', '/storage/uploads/antiochia.jpg', 'https://www.antiochia.hu/', 1, '2022-03-08 00:39:47', '2023-02-25 18:24:21', 'spiritual_movement'),
(40, 'Katolikus karizmatikus megújulás', 'katolikus-karizmatikus-megujulas', '<p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">A Katolikus Karizmatikus Megújulás a karizmatikus mozgalom katolikus változata.</p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Kezdetét a Szentlélek Kongregáció által fenntartott pittsburghi (Pennsylvania, USA) Duquesne Egyetem oktatóinak és hallgatóinak egy hétvégi lelkigyakorlatától számítják, akik arra törekedtek, hogy a Szentlélek megújítsa azokat a kegyelmeket, melyeket a keresztségben és a bérmálásban kaptak. Ezt nevezik Szentlélek-, vagy Lélek-keresztségnek.<br></p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">Amikor 1967. február 18. éjszakáján az egyetem kápolnájában kitárt karral imádkoztak, úgy érezték, hogy a Szenlélek ereje tölti el őket. Ez a megtapasztalás rövid időn belül sokfelé megismétlődött az USA katolikusai között. Azóta a világ összes földrészén jelen van a lelkiség. Egy 1990-es statisztika szerint több mint hetvenmillió katolikust tudott a lelkiségi mozgalom megszólítani. Ezek közül több mint tizenegymillió maradt aktív a statisztika készültekor.</p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">1975-76-ban alakultak az első karizmatikus csoportok Magyarországon. A közösségek összefogásával és az ICCRS támogatásával jött létre a Magyar Katolikus Karizmatikus Megújulás Országos Tanácsa, amely 1989. február 4-én hivatalosan is bemutatkozott a Magyar Katolikus Püspöki Konferencia és Paul Cordes érsek, a Világiak Pápai Tanácsának elnökhelyettese előtt. Tagjai (kb. 45 fő) az ország nagyobb közösségeinek, imacsoportjainak, illetve régióinak küldöttei. Ők választják a 8 tagú Szolgáló Bizottságot.<br></p><p style=\"color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 16px;\">A Magyar Katolikus Püspöki Konferencia és a helyi megyés püspökök irányelvei alapján működő Országos Tanács és a Szolgáló Bizottság feladata az ország területén működő karizmatikus imacsoportok, közösségek összefogása, koordinálása, tájékoztatása, vezetése. Ennek egyik megvalósulása az 1992 óta évente Budapesten megrendezésre kerülő Országos Karizmatikus Találkozó. Több ezer katolikus szokott ezen a rendezvényen összejönni dicsőítésre, imádkozásra, Oltáriszentség-imádásra, tanítások hallgatására, és szentmisén való részvételre. Itt lehetőségük van a kívülállóknak, érdeklődöknek, keresőknek megismerkedniük a lelkiséggel és a közösségekkel.</p>', '/storage/uploads/lelkisegi_mozgalmak/karizmatikus_megujulas.png', 'https://mkkm.hu/', 0, '2022-03-08 00:39:47', NULL, 'spiritual_movement'),
