(56, 'Ferencesek', 'ferencesek', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 15px; border: 0px; vertical-align: baseline; color: rgb(65, 65, 65); font-family: Arial, Helvetica, sans-serif;\">Kisebb Testvérek Rendje. Hivatásunk az Evangéliumon alapul, a szemlélődő tapasztalat táplálja és a testvéri közösségben ölt formát – Jézus nyomdokain, Assisi Szent Ferenc példájára.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 15px; border: 0px; vertical-align: baseline; color: rgb(65, 65, 65); font-family: Arial, Helvetica, sans-serif; text-align: justify;\">A Kisebb Testvérek Rendje 800 éve van jelen a társadalom szolgálatában. Ismert és elismert közösség Magyarországon és világszerte. A rend elsődleges feladata az evangelizáció, ez ugyanakkor különböző társadalmi felelősségvállalásokon keresztül is megvalósul: a ferencesek jelentős részt vállalnak a felnövekvő nemzedékek nevelésében-oktatásában, a kulturális örökség megőrzésében és megismertetésében, szegényeket, betegeket, időseket, fogyatékkal élőket, rászoruló családokat, munkanélkülieket, hajléktalanokat segítenek rendszeresen – a „minoritás”, a kisebb testvériség gondolata, a kitaszítottakkal való együttérzés szellemében, fajra, nemre, nemzetiségre, vallási, politikai vagy bármely más meggyőződésre való tekintet nélkül. Rendházaink, plébániáink, oktatási és szociális intézményeink, alapítványaink, egyéb közösségeink jól szervezett országos hálózatot képeznek. A ferences jelenlét ma országosan mintegy ötven helyszínen valósul meg. Tevékenységünket félezer állandó munkatárs segíti, aktív önkénteseink száma ennek többszöröse. A ferencesek százezreket érnek el, működésük össztársadalmi hatással bír.</p>', '/storage/uploads/ferencesek.png', '', 1, '2023-02-25 17:50:43', '2023-02-27 22:14:59', 'monastic_community');
